import React from 'react';
import '../hamburgers.css';

const Navbar = (props) => {

    const clickBtn = () => {
        props.hamburgerBtn()

        if (props.menuBtnState === false){
            return (
                <button class="hamburger hamburger--vortex" onClick={clickBtn} type="button">
                    <span class="hamburger-box">
                        <span class="hamburger-inner"></span>
                    </span>
                </button>)
        }
        else{
            return (
                <button class="hamburger hamburger--vortex is-active" onClick={clickBtn} type="button">
                    <span class="hamburger-box">
                        <span class="hamburger-inner"></span>
                    </span>
                </button>)
        }
    }

    return (<div className='Navbar'>
            {clickBtn}
        </div>)
}

export default Navbar
